import React, { useEffect, useState } from 'react';
import { Box, Button, Typography, Divider, List, ListItem, ListItemText } from "@mui/material";
import { Link } from "react-router-dom";
import './UserProfile.css'; // Adjust the path as necessary


const UserProfile = () => {
  const [userData, setUserData] = useState(null);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchUserData = async () => {
      const token = localStorage.getItem('authToken'); // Get the token from localStorage

      if (!token) {
        setError('No token found');
        return;
      }

      try {
        const response = await fetch('http://localhost:5000/api/auth/profile', {
          method: 'GET',
          headers: {
            'Authorization': `Bearer ${token}`, // Send the stored token in the request header
          },
        });

        const data = await response.json();
        if (response.ok) {
          setUserData(data);
        } else {
          throw new Error(data.msg || 'Failed to fetch profile');
        }
      } catch (error) {
        setError(error.message);
      }
    };

    fetchUserData();
  }, []); // Empty dependency array ensures this runs only once on component mount

  return (
    <Box display="flex">
    {/* Side Menu */}
    <Box
      width="250px"
      height="100vh"
      bgcolor="#f4f4f4"
      p={2}
      display="flex"
      flexDirection="column"
      justifyContent="space-between"
    >
      <Box>
        <Typography variant="h6" gutterBottom>
          User Menu
        </Typography>
        <List>
          <ListItem button component={Link} to="/company-profile">
            <ListItemText primary="Company Profile" />
          </ListItem>
          <ListItem button component={Link} to="/platform-rules">
            <ListItemText primary="Platform Rules" />
          </ListItem>
          <ListItem button component={Link} to="/common-problems">
            <ListItemText primary="Common Problems" />
          </ListItem>
          <ListItem button component={Link} to="/security-center">
            <ListItemText primary="Security Center" />
          </ListItem>
          <ListItem button component={Link} to="/funding-details">
            <ListItemText primary="Funding Details" />
          </ListItem>
          <ListItem button component={Link} to="/invite-friends">
            <ListItemText primary="Invite Friends" />
          </ListItem>
          <ListItem button component={Link} to="/my-team">
            <ListItemText primary="My Team" />
          </ListItem>
          <ListItem button component={Link} to="/quotation-tutorial">
            <ListItemText primary="Quotation Tutorial" />
          </ListItem>
        </List>
      </Box>
      <Box>
        <Button variant="contained" fullWidth sx={{ mb: 1 }}>
          Logout
        </Button>
      </Box>
    </Box>

    {/* User Profile Content */}
    <Box flex={1} p={3}>
      <Typography variant="h4" gutterBottom>
        User Profile
      </Typography>
      <Divider sx={{ mb: 3 }} />

      <div>
        {error && <Typography color="error">{error}</Typography>}
        {userData ? (
          <div>
            <Typography variant="h6">Username: <strong>{userData.username}</strong></Typography>
            <Typography variant="body1">UserID: <strong>{userData.userID}</strong></Typography>

            {/* Buttons */}
            <Box display="flex" gap={2} sx={{ mt: 2 }}>
              <Button variant="contained" color="primary">
                Recharge
              </Button>
              <Button variant="contained" color="secondary">
                Withdraw
              </Button>
            </Box>

            <Divider sx={{ my: 3 }} />

            {/* Balance and Account Status */}
            <Box display="flex" flexDirection="column" gap={2}>
              <Typography variant="h6">Balance: <strong>{userData.balance}</strong></Typography>
              <Typography variant="body1">Account Status: <strong>{userData.accountStatus}</strong></Typography>
            </Box>
          </div>
        ) : (
          <Typography>Loading...</Typography>
        )}
      </div>
    </Box>
  </Box>
  );
};

export default UserProfile;
